const domainDatabase = {};

// Helper to get missions and stats for each domain
const domainsList = ["Physical", "Mental", "Intellectual", "Social", "Creative", "Financial", "Spiritual"];

domainsList.forEach(domainName => {
    // Filter achievements for this specific domain
    const domainAchievements = achievementData.filter(a => a.domain === domainName);
    
    // Sort by rank to show progression
    domainAchievements.sort((a, b) => (a.rank || 99) - (b.rank || 99));

    // Calculate completion (for demo purposes, we'll simulate 12%)
    domainDatabase[domainName] = {
        completion: "12%",
        // Take the first 5 "missions" for the panel
        missions: domainAchievements.slice(0, 5).map(a => ({
            title: a.title,
            status: a.rankName === "Novice" ? "ACTIVE" : "LOCKED",
            xp: a.points
        })),
        // Take some titles for the badge grid
        achievements: domainAchievements
            .filter(a => a.rank === 1)
            .slice(0, 4)
            .map(a => a.title)
    };
});
